import { useState } from "react";
import  './hero.css';

const Hero = () => {
  return (
    
    <div className="w-full h-screen">
      <img
        className="image "
        src="./eco img.jpg"
        alt=""
      /> 
      <div className="z-10 bg-[#486619] h-14 w-4 text-center text-3xl font-bold"/>
      <p className="z-10 text-black"></p>
      </div>
    
  );
};

 
export default Hero;
